import { StyleSheet, Text, View } from 'react-native';
import { NativeRouter, Routes, Route } from 'react-router-native'

import {
  Home 
} from './pages'

export default function App() {
  return (
    <View>
    <NativeRouter>
      <Routes>
        <Route path="/" component={<Home />} />
      </Routes>
    </NativeRouter>
    </View>
  )
}
